import { useEffect } from 'react';
import axios from 'axios';

function App() {
  useEffect(() => {
    axios
      .get('/api/get/allApplications')
      .then((res) => context.handleAddPosts(res.data))
      .catch((err) => console.log(err));
  }, []);

  return <div>SQL - Query Controller System</div>;
}

export default App;
